import React from 'react'
import { Draggable } from 'react-beautiful-dnd'

function PanelElement({children}) {
    

  return (
    <Draggable draggableId=''>
    <div className='panel'>
        <div className="boxSelector"></div>
        {children}
    </div>
    </Draggable>
  )
}

export default PanelElement
